import React from 'react';

import './MenuItem';

interface Props {
  text: string;
  clicked?: () => unknown;
}

export const MenuItem = (props: Props) => {
  const { text, clicked } = props;

  return (
    <li className="menu-item" onClick={clicked}>{text}</li>
  )
}
